import React from 'react';

const ProductItem = ({ product }) => {
  return (
    <div>
      <h2>{product.name}</h2>
      <p>{product.gender}</p>
      <p>{product.season}</p>
      <p>${product.price}</p>
    </div>
  );
};

export default ProductItem;
